import{_ as o,r as i,o as s,c as r,a as e,b as t,w as n,d,e as l}from"./app-DPHaq2hV.js";const c={},h=d('<h1 id="快速开始" tabindex="-1"><a class="header-anchor" href="#快速开始"><span>快速开始</span></a></h1><h2 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍"><span>介绍</span></a></h2><p>Emby（原名Media Browser）是一个主从式架构的媒体服务器软件，可以用来整理服务器上的视频和音频，并将音频和视频流式传输到客户端设备。</p><p>Emby原本是大部分源代码是开源的，带有部分闭源工具，但是自从3.5.3版本开始变为闭源软件，Jellyfin为Emby开源分支基础上发展来的。</p><p>Emby服务器端支持Microsoft Windows、Linux、MacOS、FreeBSD，客户端支持HTML5网页，Android和IOS等移动操作系统，Roku、Amazon Fire TV、Chromecast和Apple TV等流媒体设备，LG智能电视和三星智能电视等智能电视，以及PlayStation3、PlayStation4、Xbox 360和Xbox One等游戏机。</p><p>简而言之，Emby是一个（曾经）开源的盗版影视服务，并且能够被自行部署。如今，很多代理（FQ）提供商都提供Emby服务作为自己的特色服务。</p><h2 id="继续阅读" tabindex="-1"><a class="header-anchor" href="#继续阅读"><span>继续阅读</span></a></h2>',7);function p(u,m){const a=i("RouteLink");return s(),r("div",null,[h,e("ul",null,[e("li",null,[t(a,{to:"/guide/install/"},{default:n(()=>[l("安装")]),_:1})]),e("li",null,[t(a,{to:"/guide/use/"},{default:n(()=>[l("使用")]),_:1})]),e("li",null,[t(a,{to:"/guide/proxy/"},{default:n(()=>[l("加速")]),_:1})])])])}const f=o(c,[["render",p],["__file","index.html.vue"]]),x=JSON.parse('{"path":"/guide/","title":"快速开始","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"介绍","slug":"介绍","link":"#介绍","children":[]},{"level":2,"title":"继续阅读","slug":"继续阅读","link":"#继续阅读","children":[]}],"filePathRelative":"guide/README.md"}');export{f as comp,x as data};
